import React, { Component } from 'react'

export default class Search extends Component {
    render() {

        return (
            <div className="row offset-3">
                <p>ssdas</p>
                <label for="search" className="col-md-1">Search:</label>
                <input id="search" onChange={()=>this.update()} className="form-control w-50 col-md-8" type="text"/>
            </div>
        )
    }

    update(){
        const text = document.getElementById('title').value;
        this.props.changeCountries(text);
    }
}
